import React from "react";
import { Link } from "react-router-dom";
import "../../scss/pages/ProductDetails.scss";
import { useEffect } from "react";
import { useStoreContext } from "../../utils/GlobalState";
import { useQuery } from "@apollo/client";
import { idbPromise } from "../../utils/helpers";
import { QUERY_ALL_PRODUCTS } from "../../utils/queries";
import { UPDATE_PRODUCTS, UPDATE_CURRENT_PRODUCTS } from "../../utils/actions";
function ProductDetailsRight() {
  const [state, dispatch] = useStoreContext();
  const { products } = state;
  const { loading, data: productsData } = useQuery(QUERY_ALL_PRODUCTS);
  useEffect(() => {
    if (productsData) {
      dispatch({
        type: UPDATE_PRODUCTS,
        productsData: productsData.products,
      });
    } else if (!loading) {
      idbPromise("products", "get").then((productsData) => {
        dispatch({
          type: UPDATE_PRODUCTS,
          productsData: productsData,
        });
      });
    }
  }, [productsData, loading, dispatch]);
  const handleClick = (id) => {
    dispatch({
      type: UPDATE_CURRENT_PRODUCTS,
      currentproductsData: id,
    });
  };
  console.log("productsData:", productsData);

  ////////////////for rendering t-shirt, jacket, sweatshirt and bottoms////////////////////
  let productToRender;

  if (
    productsData &&
    productsData.products &&
    productsData.products.name === "jacket"
  ) {
    productToRender = (
      <div className="card p-1 m-3">
        <Link to={`/products/jacket`}>
          <img
            src={`/public/images/Women/jacket/${productsData.products.name}-black`} // Dynamic image path
            alt={productsData.products.name}
          />
        </Link>
        <div className="card-body">
          <ul className="list-unstyled">
            <li>name: {productsData.products.name}</li>
            <li>price: ${productsData.products.price}</li>
          </ul>
          <button>
            <a href="#">Add to card</a>
          </button>
        </div>
      </div>
    );
  } else if (
    productsData &&
    productsData.products &&
    productsData.products.name === "t-shirt"
  ) {
    // Render t-shirt product similarly
    productToRender = (
      <div className="card p-1 m-3">
        <Link to={`/products/t-shirt`}>
          <img
            src={`/public/images/Women/t-shirt/${products.name}-black`} // Dynamic image path
            alt={products.name}
          />
        </Link>
        <div className="card-body">
          <ul className="list-unstyled">
            <li>name: {products.name}</li>
            <li>price: ${products.price}</li>
          </ul>
          <button>
            <a href="#">Add to card</a>
          </button>
        </div>
      </div>
    );
  } else if (
    productsData &&
    productsData.products &&
    productsData.products.name === "sweatshirt"
  ) {
    // Render sweatshirt product similarly
    productToRender = (
      <div className="card p-1 m-3">
        <Link to={`/products/sweatshirts`}>
          <img
            src={`/public/images/Women/jacket/${products.name}-black`} // Dynamic image path
            alt={products.name}
          />
        </Link>
        <div className="card-body">
          <ul className="list-unstyled">
            <li>name: {products.name}</li>
            <li>price: ${products.price}</li>
          </ul>
          <button>
            <a href="#">Add to card</a>
          </button>
        </div>
      </div>
    );
  } else if (
    productsData &&
    productsData.products &&
    productsData.products.name === "bottoms"
  ) {
    // Render bottoms product similarly
    productToRender = (
      <div className="card p-1 m-3">
        <Link to={`/products/bottoms`}>
          <img
            src={`/public/images/Women/jacket/${products.name}-black`} // Dynamic image path
            alt={products.name}
          />
        </Link>
        <div className="card-body">
          <ul className="list-unstyled">
            <li>name: {products.name}</li>
            <li>price: ${products.price}</li>
          </ul>
          <button>
            <a href="#">Add to card</a>
          </button>
        </div>
      </div>
    );
  }
  return <div>{productToRender}</div>;
}
export default ProductDetailsRight;
